import React, { useState } from "react";



function Li(props){
    const [isdone,setisdone] = useState(false);
function handleclick(){
    setisdone(prevValue =>{
        return !prevValue;
    });
}
    return (
    <div onClick={handleclick}>
       <li style={{textDecoration:isdone ? "line-through":"null"}}>{props.text}</li>
    </div>)
}
export default Li;
